import React from "react";
import { createBrowserRouter, RouterProvider } from "react-router-dom";
import RootLayout from "./pages/Root";
import PocetnaPage from "./pages/Pocetna";
import OMeniPage from "./pages/OMeni";
import ProjektiPage from "./pages/Projekti";
import KontaktPage from "./pages/Kontakt";

const router = createBrowserRouter([
  { path: "/", 
  element: <RootLayout />, 
  children: [
    {index: true, element: <PocetnaPage /> },
    {path:'omeni', element: <OMeniPage />},
    {path: 'projekti', element: <ProjektiPage />},
    {path:'kontakt', element: <KontaktPage />}
  ] },
]);

const App = () => {
  return <RouterProvider router={router} />;
};

export default App;
